import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import { Layout } from './components/Layout';

class App extends Component {
  render() {
      return (
    <React.Fragment>
      <Layout>
        <Router>
          <switch>
            <Route exact path="/" component={Home} />
          </switch>
        </Router>
        </Layout>
    </React.Fragment>
  );
  }
}

export default App;
